
<!DOCTYPE html>
<html lang="ar">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>خدمات ريف السعودية</title>
    <style>
        body {
            font-family: "Arial", sans-serif;
            direction: rtl;
            text-align: right;
            background-color: #f5f5f5;
            margin: 0;
            padding: 0;
        }
        .container {
            width: 100%;
            max-width: 350px;
            margin: 40px auto;
            padding: 15px;
            background-color: #ffffff;
            border-radius: 8px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            text-align: center;
        }
        .reef-logo {
            width: 80px;
            margin: 10px auto 15px auto;
            display: block;
        }
        h2 {
            color: #007b55;
            font-size: 18px;
            margin-bottom: 15px;
        }
        button {
            width: 90%;
            padding: 10px;
            font-size: 14px;
            border: none;
            color: white;
            border-radius: 5px;
            cursor: pointer;
            margin-bottom: 10px;
            transition: background-color 0.3s;
        }
        .maintenance {
            background-color: #f39c12;
        }
        .visits {
            background-color: #8e44ad;
        }
        button:hover {
            opacity: 0.9;
        }
        .footer {
            margin-top: 15px;
            font-size: 12px;
            color: #777;
            text-align: center;
        }
    </style>
</head>
